def fibonacci(n):
    """"""

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    if not is_prime(n):
        print('n is not a prime number.')
        return None
    fib_sequence = []
    (a, b) = (0, 1)
    count = 0
    while count < n:
        fib_sequence.append(a)
        (a, b) = (b, a + b)
        count += 1
    return fib_sequence
